import React, { Component } from "react";

import { Link } from "react-router-dom";
import UserNav from "./UserNav";
import Axios from "axios";
class Others extends Component {
  state = {
    userCount: {},
    errorDetails: {},
  };
  componentDidMount() {
    Axios.get("http://127.0.0.1:8000/logs/states").then((res) => {
      this.setState({ errorDetails: res.data });
      console.log(res.data);
    });
    Axios.get("http://127.0.0.1:8000/logs/userLength").then((res) => {
      this.setState({ userCount: res.data });
      console.log(res.data);
    });
  }
  render() {
    return (
      <div className="homee">
        <UserNav />

        <hr />
        <table>
          <tr>
            <td>
              <div className="card">
                <img
                  className="card-img-top"
                  src="data:image/jpeg;base64,"
                ></img>
                <div className="card-body ">
                  <h4 className="card-title">
                    Total Inspectors : {this.state.userCount.inspector}
                  </h4>
                  <h4 className="card-text">Total Batches:9</h4>
                  <br />
                  <Link to="/allControls" className="btn btn-primary">
                    View Batches
                  </Link>
                </div>
              </div>
            </td>
            <td>
              <div className="card">
                <img
                  className="card-img-top"
                  src="data:image/jpeg;base64,"
                ></img>
                <div className="card-body ">
                  <h3 className="card-title">View all Packaging Lines</h3>
                  <br />
                  <br />
                  <br />
                  <Link to="/allLine" className="btn btn-primary">
                    View Lines
                  </Link>
                </div>
              </div>
            </td>
          </tr>
        </table>
      </div>
    );
  }
}

export default Others;
